import React from 'react';
import '../CSS/End.css';

const End = ({ score, attempts, guessedCorrectly, answer, elapsedTime, onClose }) => {
  return (
    <div className="end-container">
      <h2>{guessedCorrectly ? "You Won!" : "Game Over"}</h2>
      <p>Score: {score}</p>
      <p>Attempts Used: {attempts}</p>
      <p>The correct number was: {answer}</p>
      <p>Time Played: {elapsedTime} seconds</p> {/* Display elapsed time */}
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default End;
